import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

import Show from './component/Show';

import netflix from './list';

import DateAndTime from './component/DateAndTime';

// const netflix = ["Night Agent", "Bodyguard", "class", "Rana Naidu", "manifest", "Peaky Blinders"];

// const key = netflix.map(keys=>keys);
// const name = netflix.map(names=>names);

// map[0].key

const map = netflix.map(names => names);
const today = new Date();

const date = today.getFullYear()+'-'+(today.getMonth()+1)+'-'+today.getDate();
const time = today.getHours() + ":" + today.getMinutes() + ":" + today.getSeconds();

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

  <div>
    <h1>Hello world</h1>
    <Show keys = {map[0].key} names={map[0].value}></Show>
    <Show keys = {map[1].key} names={map[1].value}></Show>
    <Show keys = {map[2].key} names={map[2].value}></Show>
    <Show keys = {map[3].key} names={map[3].value}></Show>
    <Show keys = {map[4].key} names={map[4].value}></Show>
    <DateAndTime  date = {date} time = {time}></DateAndTime>

  </div>
);
